public class SubarrayProduct {
    public static void main(String[] args) {
        int arr[] ={1,1,1};
        int k = 2;
        System.out.println(prod(arr,k));
        System.out.println(prod2(arr,k));
    }

    private static int prod2(int[] arr, int k) {
        int count = 0;
        int prod = 1;
        int l = 0 , r = 0;
        while(r<arr.length)
        {
            if(arr[r]<k){
                count++;
                prod *= arr[r];
                if (prod<k) count++;
                else{
                    while(prod>k){
                        prod = (prod/arr[l++]);
                    }
                    if(prod<k) count++;
                }
            }
            else{
                prod = 1;
                l = r+1;
            }
            r++;
        }

        while(l<r-2)
        {
            prod/=arr[l++];
            if(prod<k) count++;
        }
        return count;
    }

    private static int prod(int[] arr,int k) {
        int count = 0;

        for (int i = 0; i < arr.length; i++) {
            int max = 1;
            for (int j = i; j <arr.length ; j++) {
                max *= arr[j];
                if(max<k){
                    count++;
                }
            }
        }
        return count;
    }
}

